import React from "react";
import '../Assets/Styles/ProjectsPageStyles.css'

function ProjectsPage(){
    return(
        <main className="main" id="projects">
            <div class="dot-spinner">
                <div class="dot-spinner__dot"></div>
                <div class="dot-spinner__dot"></div>
                <div class="dot-spinner__dot"></div>
                <div class="dot-spinner__dot"></div>
                <div class="dot-spinner__dot"></div>
                <div class="dot-spinner__dot"></div>
                <div class="dot-spinner__dot"></div>
                <div class="dot-spinner__dot"></div>
                <span>In proces..</span>
            </div>
        </main>
    );
}

export default ProjectsPage;
